import React, { useEffect, useState } from "react";
import { Table, Form, Button } from "react-bootstrap";
import axiosInstance from "../axiosInstance";
import AdminHeader from "./AdminHeader";

function Zones() {
  const [cities, setCities] = useState([]);
  const [selectedCity, setSelectedCity] = useState("");
  const [zones, setZones] = useState([]);
  const [filteredZones, setFilteredZones] = useState([]);

  useEffect(() => {
    fetchCities();
    fetchAllZones();
  }, []);

  const fetchCities = async () => {
    try {
      const response = await axiosInstance.get("/api/villes");
      const data = response.data;
      setCities(data);
    } catch (error) {
      console.error("Error fetching cities:", error);
    }
  };

  const fetchAllZones = async () => {
    try {
      const response = await axiosInstance.get("/api/zones");
      const data = response.data;
      setZones(data);
      setFilteredZones(data);
    } catch (error) {
      console.error("Error fetching zones:", error);
    }
  };

  const fetchZonesByVille = async (villeName) => {
    try {
      const response = await axiosInstance.get("/api/zones/by-ville", {
        params: {
          villeName: villeName,
        },
      });
      const data = response.data;
      setFilteredZones(data);
    } catch (error) {
      console.error("Error fetching zones:", error);
    }
  };

  const handleCityChange = (e) => {
    const selectedCity = e.target.value;
    setSelectedCity(selectedCity);
    if (selectedCity === "") {
      setFilteredZones(zones);
    } else {
      fetchZonesByVille(selectedCity);
    }
  };

  const handleSearch = (e) => {
    const searchQuery = e.target.value.toLowerCase();
    const filteredCities = cities.filter((city) =>
      city.nom.toLowerCase().includes(searchQuery)
    );
    setCities(filteredCities);
  };

  const handleUpdate = (id) => {
    // Implement your update logic here
    // You can use the zone ID to identify the zone to update
    console.log("Update zone with ID:", id);
  };

  const handleDelete = (id) => {
    // Implement your delete logic here
    // You can use the zone ID to identify the zone to delete
    console.log("Delete zone with ID:", id);
  };

  return (
    <>
      <AdminHeader />

      <div className="container">
        <h1 className="mt-3" style={{ fontFamily: "cursive" }}>
          Zones
        </h1>

        <div>
          <Form.Group>
            <Form.Label className="alert alert-warning">
              SÃ©lectionnez une ville pour filtrer les zones:
            </Form.Label>
            <Form.Control as="select" onChange={handleCityChange}>
              <option value="">Select a city</option>
              {cities.map((city) => (
                <option key={city.id} value={city.nom}>
                  {city.nom}
                </option>
              ))}
            </Form.Control>
          </Form.Group>
        </div>

        <div>
          <Form.Group>
            <Form.Label>Search cities:</Form.Label>
            <Form.Control
              type="text"
              placeholder="Enter city name"
              onChange={handleSearch}
            />
          </Form.Group>
        </div>

        {filteredZones.length > 0 && (
          <Table striped bordered hover>
            <thead>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Update</th>
                <th>Delete</th>
                {/* Add more columns as needed */}
              </tr>
            </thead>
            <tbody>
              {filteredZones.map((zone) => (
                <tr key={zone.id}>
                  <td>{zone.id}</td>
                  <td>{zone.nom}</td>
                  <td>
                    <Button
                      variant="info"
                      onClick={() => handleUpdate(zone.id)}
                    >
                      Update
                    </Button>
                  </td>
                  <td>
                    <Button
                      variant="danger"
                      onClick={() => handleDelete(zone.id)}
                    >
                      Delete
                    </Button>
                  </td>
                  {/* Render additional zone properties as table cells */}
                </tr>
              ))}
            </tbody>
          </Table>
        )}
      </div>
    </>
  );
}

export default Zones;
